CREATE TABLE STOPS(
   stop_id             VARCHAR(15) NOT NULL PRIMARY KEY
  ,stop_name           VARCHAR(34) NOT NULL
  ,stop_desc           VARCHAR(30)
  ,stop_lat            NUMERIC(11,8) NOT NULL
  ,stop_lon            NUMERIC(11,8) NOT NULL
  ,zone_id             VARCHAR(30)
  ,stop_url            VARCHAR(30)
  ,location_type       BIT  NOT NULL
  ,parent_station      VARCHAR(13)
  ,wheelchair_boarding INTEGER 
);
